    top: -26px !important;
    position: relative;
}

}

@-moz-document domain("wikimedia.org") {
/* Wikimedia text */
#p-Navigation ul:first-child li:first-child a::before,
#p-navigation ul:first-child li:first-child a::before {
    content: "Wikimedia" !important;
}
}

